			shellScript = "cd \"${BUILD_DIR}\"\n\n## Build all of the Xcode configurations.\n# Mac\nxcodebuild -project \"${PROJECT_DIR}/LightsOut.xcodeproj\" -scheme LightsOutRecognizerFormPlugin -configuration Release BUILD_DIR=\"${BUILD_DIR}\"\nxcodebuild -project \"${PROJECT_DIR}/LightsOut.xcodeproj\" -scheme LightsOutSolverFormPlugin -configuration Release BUILD_DIR=\"${BUILD_DIR}\"\n\n# iOS\nxcodebuild -project \"${PROJECT_DIR}/LightsOut.xcodeproj\" -scheme LightsOutRecognizerPerformPlugin -configuration Release -sdk iphoneos BUILD_DIR=\"${BUILD_DIR}\"\nxcodebuild -project \"${PROJECT_DIR}/LightsOut.xcodeproj\" -scheme LightsOutRecognizerPerformPlugin -configuration Release -sdk iphonesimulator BUILD_DIR=\"${BUILD_DIR}\"\nxcodebuild -project \"${PROJECT_DIR}/LightsOut.xcodeproj\" -scheme LightsOutSolverPerformPlugin -configuration Release -sdk iphoneos BUILD_DIR=\"${BUILD_DIR}\"\nxcodebuild -project \"${PROJECT_DIR}/LightsOut.xcodeproj\" -scheme LightsOutSolverPerformPlugin -configuration Release -sdk iphonesimulator BUILD_DIR=\"${BUILD_DIR}\"\n\n# Create the destination directory.\nDEST_DIR=./LightsOut\nrm -rf $DEST_DIR\nmkdir -p \"$DEST_DIR/LightsOutRecognizer.formplugin\"\nmkdir -p \"$DEST_DIR/LightsOutSolver.formplugin\"\n\n# Copy the OSX build\ncp -fR \"./Release/LightsOutRecognizerFormPlugin.formplugin/\" \"$DEST_DIR/LightsOutRecognizer.formplugin/\"\ncp -fR \"./Release/LightsOutSolverFormPlugin.formplugin/\" \"$DEST_DIR/LightsOutSolver.formplugin/\"\n\n# Copy the iOS build\ncp -fR \"./Release-iphoneos/LightsOutRecognizerPerformPlugin.framework\" \"$DEST_DIR/LightsOutRecognizerPerformPlugin.framework\"\ncp -fR \"./Release-iphoneos/LightsOutSolverPerformPlugin.framework\" \"$DEST_DIR/LightsOutSolverPerformPlugin.framework\"\n\n# lipo the iOS build\nlipo -create \"${BUILD_DIR}/Release-iphonesimulator/LightsOutRecognizerPerformPlugin.framework/LightsOutRecognizerPerformPlugin\" \"${BUILD_DIR}/Release-iphoneos/LightsOutRecognizerPerformPlugin.framework/LightsOutRecognizerPerformPlugin\" -output \"$DEST_DIR/LightsOutRecognizerPerformPlugin.framework/LightsOutRecognizerPerformPlugin\"\nlipo -create \"${BUILD_DIR}/Release-iphonesimulator/LightsOutSolverPerformPlugin.framework/LightsOutSolverPerformPlugin\" \"${BUILD_DIR}/Release-iphoneos/LightsOutSolverPerformPlugin.framework/LightsOutSolverPerformPlugin\" -output \"$DEST_DIR/LightsOutSolverPerformPlugin.framework/LightsOutSolverPerformPlugin\"\n\n# Copy the iOS build into the OSX plugin for safe keeping\nmkdir -p \"$DEST_DIR/LightsOutRecognizer.formplugin/Contents/Perform/\"\ncp -fR \"$DEST_DIR/LightsOutRecognizerPerformPlugin.framework\" \"$DEST_DIR/LightsOutRecognizer.formplugin/Contents/Perform/\"\nmkdir -p \"$DEST_DIR/LightsOutSolver.formplugin/Contents/Perform/\"\ncp -fR \"$DEST_DIR/LightsOutSolverPerformPlugin.framework\" \"$DEST_DIR/LightsOutSolver.formplugin/Contents/Perform/\"\n\n# Install plugin\nmkdir -p \"$HOME/Library/Application Support/Form/PlugIns/\"\ncp -fR \"$DEST_DIR/LightsOutRecognizer.formplugin\" \"$HOME/Library/Application Support/Form/PlugIns/\"\ncp -fR \"$DEST_DIR/LightsOutSolver.formplugin\" \"$HOME/Library/Application Support/Form/PlugIns/\"\n\n# Reveal the finished plugin if we're archiving\nif [ \"${CONFIGURATION}\" = \"Release\" ]; then\nopen --reveal $DEST_DIR\nfi\n";
